let timeOut = null
//==========Calculate Time==
const calculateTime=()=>{
        let min=0;
        let sec=0;
        timeOut  = setInterval(()=>{
           sec+=1;
           if(sec<10){
               $('#sec').html('0'+ sec);
           }else {
               $('#sec').html(sec);
           }
           if(sec==60){
               sec=0;
               min+=1;
           }
           if(min<10){
               $('#min').html('0'+ min);
           }else {
               $('#min').html(min);
           }
        },1000);

}
//==========Calculate Time==
const placeOrder=(item)=>{
    //===========Time generator===========
    if(!isInAnOrder){
        isInAnOrder=true;
        calculateTime();
    }
    //===========Time generator===========
    // itemForOrder.push(item);
    // let temp =alacarta.filter(e=> e.id==item);
    let temp =alacarta.find(e=> e.id==item);
    item ={
        id: temp.id,
        name : temp.name,
        requestedQty:1,
        total:temp.price
    }
    const exists = isAlreadyExist(temp.id);

    if(qty!=0){
        tempQty =  Number(qty);
        total = temp.price*tempQty;
        item['requestedQty'] = tempQty;
        item['total'] =total;

    }

    if(item.total>=5000){
       let pwd = prompt('we have detected, there are some suspicious behaviors!');
       if(pwd !='123'){
           alert('you can\'t make this order')
           return
       }
    }


    if(exists!=-1){

        isExistsQty = item.requestedQty + itemForOrder[exists].requestedQty;
        isExistsTotal = item['total'] +  itemForOrder[exists].total;
        itemForOrder[exists]={
                id:itemForOrder[exists].id,
                name:itemForOrder.name,
                requestedQty: isExistsQty,
                total:isExistsTotal,
                name : temp.name
        }
    }else {

        itemForOrder.push(item);
    }

    loadOrderTableData();
}

const loadOrderTableData=()=>{
    let html='';
    itemForOrder.forEach(resp=>{
        html+=`<tr onclick="removeItem('${resp.id}')">
                <td>${resp.name}</td>
                <td>${resp.requestedQty}</td>
                <td>${resp.total}</td>
    </tr>`;

    })
        $('#order-items').html(html);
        calculateTotal();
}

const isAlreadyExist=(id)=>{
    for (let x=0; x<itemForOrder.length; x++){
        if(itemForOrder[x].id==id){
            return x;
        }
    }
    return -1;
}

