const generateOderId=()=>{
    let ordersSet =JSON.parse(localStorage.getItem('orders'));
    if(ordersSet!= null){
        let tempId = Number(ordersSet[ordersSet.length-1].id.toString().split('-')[1]);
        let number = tempId+1;
        if(number<9){
            orderId = 'D-00'+number;
        }else if(number<99){
            orderId = 'D-0'+number
        }else {
            orderId = 'D-'+number
        }
    }else {
        orderId= 'D-001';
    }
}

